import React, { useState } from 'react'

export default function Ardupilot() {

  const configs = ['Flight Mode', 'Standard Params', 'Advanced Params', 'Full Parameter List', 'Help']
  const [selectedConfig, setSelectedConfig] = useState(['Flight Mode'])

  return (
    <div className='h-auto'>

      <div className='bg-banner-color text-white w-1/3 border flex flex-col'>
        {
          configs.map((x) =>
            <span className={`p-2 hover:font-bold ${configs.includes(x) ? 'font-bold':''}`}>
              {x}
            </span>
          )
        }
      </div>

    </div>
  )
}
